import { FaShoppingCart } from "react-icons/fa";

const Navbar = () => {
  return (
    <div>
      <div className="flex justify-between">
        <img src="../../../study_notion_app_project/src/assets/" alt="images will be displayed" />
        <div>
          <p>Home</p>
          <FaShoppingCart />
        </div>
      </div>
    </div>
  );
};

export default Navbar;
